(38, 7, 6055230745974, 'Mirafiori Lovers', 'Fiat 131 cars', 'The 131 also called the Mirafiori was a replacement for the Fiat 124. The car was available not only as a 4-door saloon but also as a 5-door estate. The Mirafiori name came from the Turin suburb that the car was produced in.  Built using a steel monocoque body, the 131 used a fully independent front suspension, with MacPherson struts, track control arms and an anti-roll bar, while at the back it used double unequal length trailing arms and a panhard rod, with coil springs and direct acting dampers. This setup granted handling superiority compared to many of the model''s competitors.', 'www.autoevolution.com/caras/fiat-131-mirafiori-4-doors-1978.html#aeng_fiat-131-mirafiori-4-doors-1978-13-4mt-65-hp', '', 'act_231184597227956', '', '', '', '', '', '', '', '', 'link_ad', '', '', '2016-05-26 23:14:51', '2016-05-10 00:38:10', '2016-05-26 23:14:51'),
